import React from 'react';
import AllStudentsGraph from '../../containers/AllStudentsGraph.js';
import { render } from 'react-dom';
import Data from '../Data/Data';
// import ChartExample from "../ChartExample/ChartExample";

class App extends React.Component {
	constructor() {
		super();
		this.state = {
			dataList: Data
		};
	}

	render() {
		return (
			<div className="App" style={{ backgroundColor: 'light blue' }}>
				<h1 style={{ textAlign: 'center', color: 'dark grey' }}>Student Dashboard</h1>
				<div>
					<h3 style={{ textAlign: 'center', color: 'tomato' }}>All Students Average</h3>
					<AllStudentsGraph data={this.state.dataList} />
				</div>
			</div>
		);
	}
}

export default App;
